pragma solidity ^0.5.0;

import 'openzeppelin-solidity/contracts/token/ERC20/ERC20.sol';

contract StockToken is ERC20 {
  // The keyword "public" makes variables
  // accessible from other contracts
  // 1.   
  address public corporationAddress; //    
  string public corporation; //   
  string public name; //  
  string public symbol; // 
  uint public decimals; //   
  uint public initialSupply; //  

  struct Holders {
    // string holdersName; // 
    string id; //  +   
    uint stockAmount;  //  
  }

mapping(address => Holders) public certHolders; //    .


    // Events allow clients to react to specific
    // contract changes you declare
    // 2.  
    //      ,   ,   
    event Sent(address indexed from, address indexed to, uint amount);


  constructor() public {
    corporationAddress = msg.sender;
  }

  // Sends an amount of newly created coins to an address
    // Can only be called by the contract creator
    // 3.  (       )
    function publishToken(string memory _corporation, string memory _name, string memory _symbol, uint _decimals, uint _initialSupply) public {
        require(msg.sender == corporationAddress);
        require(initialSupply < 1e60);
        corporation = _corporation;
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        initialSupply = _initialSupply;

        _mint(msg.sender, initialSupply);

        // balances[corporationAddress] += totalSupply; //        .
    }
}
